import React from 'react';

function DashboardHTML({ allUsers }) {
  return (
    <div className="container">
      <div className="row">
        <div className="d-flex justify-content-around">
          {allUsers.map(user => (
            user.id === session.uuid && <h2 key={user.id}>Welcome: {user.full_name}</h2>
          ))}
        </div>
      </div>

      <a className="text-danger" href="/user/logout"> Logout </a>

      <div className="d-flex justify-content-center">
        <h1><a href="/nominee/dashboard"> Nominator Dashboard </a></h1>
      </div>

      <div className="d-flex justify-content-center">
        <h1><a href="/recommender/dashboard"> Recommender Dashboard</a></h1>
      </div>

      <div className="d-flex justify-content-center">
        <h1><a href="/review/dashboard"> Review Committee Dashboard</a></h1>
      </div>
    </div>
  );
}

export default DashboardHTML;
